import React from 'react';
import { Navigate } from 'react-router-dom';

const AdminDashboard = () => {
  // TODO: Add proper authentication check
  const isAuthenticated = false;

  if (!isAuthenticated) {
    return <Navigate to="/login" replace />;
  }

  return (
    <div className="container py-12">
      <h1 className="section-title">Admin Dashboard</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        <div className="p-6 bg-white shadow-lg rounded-lg">
          <h2 className="text-xl font-serif mb-4">Reservations</h2>
          <p className="text-gray-600">Manage restaurant reservations</p>
        </div>
        <div className="p-6 bg-white shadow-lg rounded-lg">
          <h2 className="text-xl font-serif mb-4">Menu Items</h2>
          <p className="text-gray-600">Update menu items and prices</p>
        </div>
        <div className="p-6 bg-white shadow-lg rounded-lg">
          <h2 className="text-xl font-serif mb-4">Gallery</h2>
          <p className="text-gray-600">Manage gallery images</p>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
